const defaultValue = [{
        year: 2000,
        data: '크리스마스'
    },
    {
        year: 2001,
        data: '롤리팝'
    },
    {
        year: 2010,
        data: '안드로이드'
    },
    {
        year: 2015,
        data: '리엑트네이티브'
    },
    {
        year: 2018,
        data: '곧 2019'
    }
];

function printYears(years = defaultValue) {
    console.log(years);
}

printYears();

printYears({
    year: 2018,
    data: '곧 2019'
});
